import React, {useState} from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import LikedMovieRouter from './components/LikedMoviesRoute';
import MoviesRoute from './components/MoviesRoute';
import Navigation from './components/nav/Navigation';
import LikedMovieProvider from './store/AuthContext';
function App() {
  const [liked, setLiked] = useState([]);
  let a = [];
  const passLikedMoviesHandler = movieData => a.push(movieData);
  console.log(liked);
  return (
    <LikedMovieProvider.Provider value={a}>
      <div className="App">
        <Navigation />
        {/* -------------- Beginning of router ----------------- */}
        <Router>
          <Routes>
            <Route
              path="/"
              element={<MoviesRoute userLikedMovies={passLikedMoviesHandler} />}
            />
            <Route
              path="/liked"
              element={
                <LikedMovieRouter userLikedMovies={passLikedMoviesHandler} />
              }
            />
          </Routes>
        </Router>
        {/* -------------- End of Router ---------------- */}
      </div>
    </LikedMovieProvider.Provider>
  );
}

export default App;
